problem:
On a protractor, ray $BA$ goes through the 140-degree mark and ray $BC$ goes through the 74-degree mark. What is the measure, in degrees, of angle $ABC$?

[asy]
draw((0,0)--(2,0)..(1,1)..(0,0)..cycle,linewidth(2));

draw((1,0)--1.4dir(74)+(1,0),Arrow);
draw((1,0)--1.3dir(140)+(1,0),Arrow);

dot(1.1dir(140)+(1,0));
dot(1.2dir(74)+(1,0));

label("A",1.1dir(140)+(1,0),NW);
label("B",(1,0),S);
label("C",1.2dir(74)+(1,0),SE);

label("140",.9dir(140)+(1,0));
label("74",.9dir(74)+(1,0));

[/asy]
